import React from 'react';

function Landing(props) {
    console.log(props)
    return (
        
        <div>
            <button onClick={() => props.onClick()}>Create Party</button>
            <button onClick={() => props.onClick()}>Join Party</button>
            <button onClick={() => props.onClick()}>How to Play</button>
        </div>
    );
}

export default Landing;
